import React, { useEffect,useState } from 'react';
import axios from 'axios';
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn,
  MDBRipple
} from 'mdb-react-ui-kit';

function Book() {
  const [doctors, setDoctors] = useState([]);
    useEffect(() => {
        axios.get('/dataload')
        .then(response => {
          setDoctors(response.data);
        })
        .catch(error => {
          console.log(error);
        })
      }, []);
    return(
        <div className="App">
      {doctors.map(doc => (
            <div key={doc._id}>
               <MDBCard>
      <MDBRipple rippleColor='light' rippleTag='div' className='bg-image hover-overlay'>
        <MDBCardImage src='' fluid alt='...' />

      </MDBRipple>
      <MDBCardBody>
        <MDBCardTitle>{doc.name}</MDBCardTitle>
        <MDBCardText>
        {doc.message}
        </MDBCardText>
        <MDBBtn href='#'>Button</MDBBtn>
      </MDBCardBody>
    </MDBCard>
            </div>
        ))}
        </div>
    );
}
export default Book;
